import classes from "./ResultsTable.module.css";
import TableBody from "./TableBody";
import TableHead from "./TableHead";

const HeadFields = [
  { field: "Year", id: 0 },
  { field: "Total Savings", id: 1 },
  { field: "Interest (Year)", id: 2 },
  { field: "Total Interest", id: 3 },
  { field: "Invested Capital", id: 4 },
];
const BodyFields = [
  { field: "YEAR NUMBER", id: 0 },
  { field: "TOTAL SAVINGS END OF YEAR", id: 1 },
  { field: "INTEREST GAINED IN YEAR", id: 2 },
  { field: "TOTAL INTEREST GAINED", id: 3 },
  { field: "TOTAL INVESTED CAPITAL", id: 4 },
];

function ResultsTable() {
  return (
    <table className={classes.result}>
      <TableHead headFields={HeadFields} />
      <TableBody bodyFields={BodyFields} />
    </table>
  );
}

export default ResultsTable;
